// TermsAndConditions.js
import React from 'react';
import './Termosecondicoes.css';
const TermsAndConditions = () => {
  return (
    <div className="terms-container">
      <h2>Termos e Condições</h2>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed euismod
        euismod mi, et feugiat leo lacinia sed. Phasellus finibus orci
        eu ligula feugiat rutrum. Nullam ullamcorper commodo dolor, nec
        tristique quam lobortis vitae. Vestibulum ante ipsum primis in faucibus
        orci luctus et ultrices posuere cubilia curae;
      </p>
      {/* Adicione mais parágrafos com seus termos e condições */}
    </div>
  );
};

export default Termosecondicoes;
